import React from "react";
import { Link } from "react-router-dom";
function Header() {
  return (
    <div className="ui secondary pointing menu">
      <Link to="/" className="item">
        Streamer
      </Link>
      <div className="right menu"></div>
    </div>
  );
}

export default Header;
